import React from 'react';
import { ListGroup, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const HelpSidebar = () => {
  return (
    <ListGroup className="mb-3">
      <ListGroup.Item active>Ay√∫danos</ListGroup.Item>
      <ListGroup.Item>
        <Button as={Link} to="/register" variant="link" className="p-0">
          Adopta o acoge
        </Button>
      </ListGroup.Item>
      <ListGroup.Item>
        <Button as={Link} to="/register" variant="link" className="p-0">
          Hazte socio o padrino
        </Button>
      </ListGroup.Item>
      <ListGroup.Item>
        <Button as={Link} to="/register" variant="link" className="p-0">
          Hazte voluntario
        </Button>
      </ListGroup.Item>
      <ListGroup.Item>
        <Button as={Link} to="/register" variant="link" className="p-0">
          Difunde
        </Button>
      </ListGroup.Item>
      <ListGroup.Item action href="#">Tienda Solidaria</ListGroup.Item>
      <ListGroup.Item action href="#">Contacta con nosotros</ListGroup.Item>
    </ListGroup>
  );
};

export default HelpSidebar;
